import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {
  BrowserRouter as Router, // Change import to BrowserRouter
  Route,
  Routes,
  Link, // Import Link component
} from 'react-router-dom';
import Upload from './components/Upload';
import ThumbnailList from './components/ThumbnailList';

const routing = (
  <Router>
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/upload">Home</Link> {/* Navigate to Upload component */}
          </li>
          <li>
            <Link to="/ThumbnailList">Thumbnail</Link> {/* Navigate to ThumbnailList component */}
          </li>
        </ul>
      </nav>
      <Routes>
      <Route exact path="/" component={App} />
      <Route path="/upload" component={Upload} />
      <Route path="/ThumbnailList" component={ThumbnailList} />
      </Routes>
    </div>
  </Router>
);

ReactDOM.render(routing, document.getElementById('root'));
